import React from 'react'
import { Link } from 'react-router-dom'
import Navlogged from './Navlogged'
import Navnolog from './Navnolog'

function Navbar({auth}) {
  if(auth){
    return <Navlogged/>  
}
else{
    return <Navnolog/>
}
}

export default Navbar
